import React, { Component } from 'react';
import {BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import { Security, SecureRoute, ImplicitCallback } from '@okta/okta-react';
import './App.css';
import FrontPage from './pages/front-page.js';
import AddEmployee from './pages/addEmployee';
import ChartsPage from './pages/chartsPage';
import Employees from './pages/employees';
import Login from './pages/login';

function onAuthRequired({history}) {
  history.push('/login');
}

class App extends Component {
  render() {
    const App = () => (
      <div>
        <Router>
            <Security issuer='https://dev-857287.oktapreview.com/oauth2/default'
                      client_id='0oahphozqyYtp44XS0h7'
                      redirect_uri={window.location.origin + '/implicit/callback'}
                      onAuthRequired={onAuthRequired} >

              <Route exact path='/' render={() => <Login baseUrl='https://dev-857287.oktapreview.com'/>}/>
              <SecureRoute path='/front-page' component={FrontPage}/>
              <Route path='/addEmployee' component={AddEmployee}/>
              <Route path='/chart' component={ChartsPage}/>
              <Route path='/employees' component={Employees}/>
            </Security>
        </Router>
      </div>
    )
    return (
      <Switch>
        <App/>
      </Switch>
    );
  }
}

export default App;
